import Wmenu from "./Wmenu"

const Wmain = () => {

    return (
        <>
            <Wmenu />
            <RouterNv />
    <Routes>
        <Route path="/" element={<RouterHome/>} />
        <Route path="/p1/:item" element={<RouterPage1/>}/>
        <Route path="/p2" element={<RouterPage2/>}/>
    </Routes>
        </>
    );
    
    }
    export default Wmain;
